import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      main: "Main",
      servise: "Servise",
      forAs: "For as",
      contact: "Contact",

      action: "",
    };
    this.select = this.select.bind(this);
  }

  render() {
    return (
      <div>
        <header>
          <div onClick={() => this.setState({ action: "Main" })}>
            {this.state.main}
          </div>
          <div> {this.state.servise}</div>
          <div>{this.state.forAs}</div>
          <div>{this.state.contact}</div>
        </header>
        if({this.state.action} !== ""){<div>Selected:{this.state.action}</div>}
      </div>
    );
  }
}
export default App;
